'use strict';
//@@DocInclude
//@@DocBrief("The class provides access to identification information of the order")
class OrderInfo {
    orderId;
    status;
    isExecutedField;
    error;
    tradeId;
    requestTxt;
    constructor() {
        this.orderId = null;
        this.isExecutedField = false;
        this.error = null;
        this.status = null;
        this.tradeId = null;
        this.requestTxt = null;
    }
    getOrderId() {
        return this.orderId;
    }
    isExecuted() {
        return this.isExecutedField;
    }
    getStatus() {
        return this.status;
    }
    getTradeId() {
        return this.tradeId;
    }
    getRequestTxt() {
        return this.requestTxt;
    }
    hasError() {
        return this.error != null;
    }
    getError() {
        return this.error;
    }
}
module.exports = OrderInfo
